Here is the JSON array for the task of ordering and maintaining an inventory of supplies:

<OUTPUT_JSON>
[
  {
    "action": "click",
    "selector": "input[placeholder*=search i]",
    "text": ""
  },
  {
    "action": "type",
    "selector": "input[placeholder*=search i]", 
    "text": "{item_name}"
  },
  {
    "action": "click",
    "selector": "button:has-text(\"add item\" i)",
    "text": ""
  },
  {
    "action": "type",
    "selector": "input[name*=quantity i]",
    "text": "{quantity}"
  },
  {
    "action": "click",
    "selector": "button:has-text(\"order\" i), button:has-text(\"submit\" i)",
    "text": ""
  }
]
</OUTPUT_JSON>
